de.EPAL_DESC_103:
Die Verkabelung an CN1 überprüfen: 
n- Bei einphasigem Betrieb sicherstellen, dass das Erdungskabel an PE, der Neutralleiter an N und das Phasenkabel an T angeschlossen ist; 
Bei dreiphasigem Betrieb sicherstellen, dass das Erdungskabel an PE, der Neutralleiter an N und die Phasenkabel L1, L2 und L3 an R, S und T angeschlossen sind.

en.EPAL_DESC_103:
Check the cabling on CN1:
- in single-phase, make sure that ground cable is connected to PE, the Neutral cable is connected to N and the phase cable to T;
- in three-phase, make sure that the ground cable is connected to PE, the Neutral cable is connected to N and the phase cables L1, L2 and L3 are connected to R, S, and T.

es.EPAL_DESC_103:
Verifique el cableado en CN1: 
- en una monofásica, asegúrese de que el cable de tierra esté conectado a PE, el cable neutro está conectado a N y el cable de fase a T; 
- en tres fases , asegúrese de que el cable de tierra esté conectado a PE, el cable neutro está conectado a N y los cables de fase L1, L2 y L3 están conectados a R, S y T.

fr.EPAL_DESC_103:
Vérifiez le câblage sur CN1: 
- en phase unique, assurez-vous que le câble de terre est connecté à PE, le câble neutre est connecté à n et le câble de phase à t; 
- en trois phases , assurez-vous que le câble de terre est connecté à PE, le câble neutre est connecté à N et que les câbles de phase L1, L2 et L3 sont connectés à R, S et T.

it.EPAL_DESC_103:
Verificare il cablaggio in CN1:
- monofase, accertarsi che il cavo di terra sia collegato a PE, il cavo di neutro sia collegato a N e il cavo di fase a T;
- trifase, accertarsi che il cavo di terra sia collegato a PE, il cavo di neutro sia collegato a N e i cavi di fase L1, L2 ed L3 siano collegati a R, S e T.

nl.EPAL_DESC_103:
Controleer de bekabeling op CN1: 
- in eenfase, zorg ervoor dat de aardkabel is aangesloten op PE, de neutrale kabel is verbonden met N en de fasekabel tot T; 
- in driefase , zorg ervoor dat de grondkabel is aangesloten op PE, de neutrale kabel is verbonden met N en de fasekabels L1, L2 en L3 zijn verbonden met R, S en T.
